import Aff from "./Afficher"
export default function Home(props){
    return( 
    <>
        <div className="con">
        {
            props.movie.map((mov,i)=>{
                return ( 
                    <Aff movie={mov} key={i} /> 
                )
            })
        }
        
    </div></>
    )
}
